import React, { useState, useEffect } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Image, StyleSheet } from 'react-native';
import CheckoutScreen from './src/Checkout';

// import Login from './src/login';
// import Signup from './src/signup';
import HomeScreen from './src/HomeScreen';
import MapScreen from './src/MapScreen';
import SettingsScreen from './src/SettingsScreen';
import SavedScreen from './src/SavedScreen';
import InfoScreen from './src/InfoScreen';
import Seeddata from './';

const homeIconActive = require('./src/assets/icons/home-active.png');
const homeIcon = require('./src/assets/icons/home.png');
const compassIconActive = require('./src/assets/icons/compass-active.png');
const compassIcon = require('./src/assets/icons/compass.png');
const savedIconActive = require('./src/assets/icons/saved-active.png');
const savedIcon = require('./src/assets/icons/saved.png');
const settingsIconActive = require('./src/assets/icons/settings-active.png');
const settingsIcon = require('./src/assets/icons/settings.png');

const Stack = createNativeStackNavigator();
const Tab = createBottomTabNavigator();


function HomeStack() {
  return (
    <Stack.Navigator
      screenOptions={{
        headerShown: false,
      }}
    >
      <Stack.Screen name="Initial" component={HomeScreen} />
      <Stack.Screen name="Info">
        {(props) => <InfoScreen {...props} navigation={navigation} />}
      </Stack.Screen>
      <Stack.Screen name="Checkout" component={CheckoutScreen} />
    </Stack.Navigator>
  );
}

export default function App() {
  const [isLoggedIn, setLoggedIn] = useState(true); // Set to true for testing

  // Function to update login state
  const handleLogin = () => {
    setLoggedIn(true);
  };

  useEffect(() => {
    Seeddata(); // Assuming Seeddata is a function that seeds data
  }, []);

  return (
    <NavigationContainer>
      {isLoggedIn ? (
        <Tab.Navigator
          screenOptions={({ route }) => ({
            headerShown: false,
            tabBarIcon: ({ focused }) => {
              let iconName;

              if (route.name === 'Home') {
                iconName = focused ? homeIconActive : homeIcon;
              } else if (route.name === 'Map') {
                iconName = focused ? compassIconActive : compassIcon;
              } else if (route.name === 'Saved') {
                iconName = focused ? savedIconActive : savedIcon;
              } else if (route.name === 'Settings') {
                iconName = focused ? settingsIconActive : settingsIcon;
              }

              return <Image source={iconName} resizeMode="contain" style={styles.footerIcon} />;
            },
            tabBarShowLabel: false,
            tabBarStyle: {
              position: 'absolute',
              padding: 10,
              backgroundColor: 'black',
              borderTopStartRadius: 40,
              borderTopEndRadius: 40,
            },
          })}
        >
          <Tab.Screen name="Home" component={HomeStack} />
          <Tab.Screen name="Map" component={MapScreen} />
          <Tab.Screen name="Saved" component={SavedScreen} />
          <Tab.Screen name="Settings" component={SettingsScreen} />
        </Tab.Navigator>
      ) : (
        // <Stack.Navigator>
        //   <Stack.Screen name="Login">
        //     {() => <Login onLogin={handleLogin} />}
        //   </Stack.Screen>
        //   <Stack.Screen name="Signup" component={Signup} />
        // </Stack.Navigator>
        // Render the HomeScreen directly
        <HomeStack />
      )}
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  footerIcon: {
    width: 25,
  },
});
